<?php
class Trip extends CI_Controller {
	public function __construct() {
		parent::__construct();
		/*
		 load you helper library
		 */
		/*
		 load you model
		 */
		$this -> load -> model('trip_model');
		$this->load->helper('string');
	}

	public function index() {
		$email = $this -> input -> post("email");
		$taxiPlate = $this -> input -> post("taxiPlate");
		$taxiLicense = $this -> input -> post("taxiLicense");
		$taxiColor = $this -> input -> post("taxiColor");
		$startLat = $this -> input -> post("startLat");
		$startLng = $this -> input -> post("startLng");
		$desLat = $this -> input -> post("desLat");
		$desLng = $this -> input -> post("desLng");
		$lpPic = $this -> input -> post("licensePlatePic");
		$dnPic = $this -> input -> post("driverNumberPic");
		$lpPicName = "";
		$dnPicName = "";
		$randomNum = random_string('numeric', 4);
		//$finished = 1;
		//$finished = $this -> input -> post("finished");

		if ($lpPic != "") {
			$decodedLPPic = base64_decode($this -> input -> post("licensePlatePic"));
			$lpPicName = $email . "_license_plate_pic_" . $randomNum . ".jpg";
			file_put_contents("./uploads/$lpPicName", $decodedLPPic);
		}
		if ($dnPic != "") {
			$decodedDNPic = base64_decode($this -> input -> post("driverNumberPic"));
			$dnPicName = $email . "_driver_number_pic_" . $randomNum . ".jpg";
			file_put_contents("./uploads/$dnPicName", $decodedDNPic);
		}
		
		$id = $this -> trip_model -> create_trip($email, $taxiPlate, $taxiLicense, $taxiColor, $startLat,
		$startLng, $desLat, $desLng, $lpPicName, $dnPicName);

		$query = $this -> trip_model -> check_trip($id);
		if ($query) {
			$arr['success'] = "1";
			$arr['error'] = "0";
			$arr['error_msg'] = "";
			$arr['tripID'] = $id;
		} else {
			$arr['success'] = "0";
			$arr['error'] = "1";
			$arr['error_msg'] = "Your trip was not stored in database. Please try again";
			$arr['tripID'] = 0;
		}
		echo json_encode($arr);
	}

